function counter(){
    var count=0;
    const increment=()=>{
        count++;
        console.log(count);
    }
    const decrement=()=>{
        count--;
        console.log(count);
    }
    return(
        <div>
            <h3>Counter App</h3>
            <h4>Counter : {count}</h4>
            <button onClick={increment}>Increment</button>
            <button onClick={decrement}>Decrement</button>
        </div>
    )
}

export default counter
